var calcScore = function(i){
	var score;
	var f = foodData[i][1].num_of_food;
	var h = healthData[i][1].num_of_hospitals;
	var s = schoolData[i][1].num_of_schools;
	foodscore = calcFoodScore(f);
	healthscore = calcHealthScore(h);
	educationscore = calcEducationScore(s);
	var temp = (foodscore*foodWeight)+(healthscore*healthWeight)+(educationscore*educationWeight);
	var tot_w = foodWeight+healthWeight+educationWeight;
	score = temp/tot_w;
	return score;
};

